package com.ysu.util;

public class Point {
	private String x;
	private double y;
	private double y1;
	private double y2;
	private double y3;
	private double y4;
	private double y5;
	private double z;
	public Point(String x, double y, double y1, double y2, double y3, double y4, double y5, double z) {
		super();
		this.x = x;
		this.y = y;
		this.y1 = y1;
		this.y2 = y2;
		this.y3 = y3;
		this.y4 = y4;
		this.y5 = y5;
		this.z = z;
	}
	public Point() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getX() {
		return x;
	}
	public void setX(String x) {
		this.x = x;
	}
	public double getY() {
		return y;
	}
	public void setY(double y) {
		this.y = y;
	}
	public double getY1() {
		return y1;
	}
	public void setY1(double y1) {
		this.y1 = y1;
	}
	public double getY2() {
		return y2;
	}
	public void setY2(double y2) {
		this.y2 = y2;
	}
	public double getY3() {
		return y3;
	}
	public void setY3(double y3) {
		this.y3 = y3;
	}
	public double getY4() {
		return y4;
	}
	public void setY4(double y4) {
		this.y4 = y4;
	}
	public double getY5() {
		return y5;
	}
	public void setY5(double y5) {
		this.y5 = y5;
	}
	public double getZ() {
		return z;
	}
	public void setZ(double z) {
		this.z = z;
	}
	
}
